css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("thinkgeek.com") {

  body {
    background-color: #222;
    color: #fff;
  }
  
  #sitewide-ribbon {
    background-color: #7AC142;
  }
  
  
  #nav-top-secondary {
    background-color: #444;
    color: #ccc;
  }
  
  #nav-top-secondary a{
    color: #ccc;
  }
  
  #nav-top-secondary a:hover{
    color: #7AC142;
  }
  
  
  #nav-top-primary #topnav_search input[type="text"] {
    background-color: #666;
    color: #000;
  }
  
    #nav-top-primary #topnav_search input[type="text"]:focus {
    background-color: #666;
    color: #000;
  }
  
  
  #nav-top-primary #topnav_search form.active input[type="text"] {
    background-color: #666;
  }
  
  .topnav_tertiary {
    background-color: #999;
  }
  
  
  #footer-help {
    background-color: #333;
  }
  
  
  #footer-wrapper {
    background-color: #444;
  }
  
}
